# day 2, first puzzle

import day2

inputs = ("",
          "",
          "",
          "",
          "")

r = (1, 2, 3), (4, 5, 6), (7, 8, 9)

lb = 0, 0, 0
rb = 2, 2, 2
tb = 0, 0, 0
bb = 2, 2, 2

bounds = lb, rb, tb, bb

def Process():

    decoder = day2.Decoder(r, bounds, 1, 1)

    code = []

    for input in inputs:
        result = decoder.Decode(input)
        code.append(result)
    
    return code
